DROP DATABASE IF EXISTS myfamily;
CREATE DATABASE myfamily;
USE myfamily;

DROP USER IF EXISTS 'declan'@'localhost';
CREATE USER 'declan'@'localhost' IDENTIFIED BY 'ryan';
GRANT ALL PRIVILEGES ON myfamily . * TO 'declan'@'localhost';

CREATE TABLE users (
  user_id INT NOT NULL UNIQUE auto_increment,
  user_email varchar(20) NOT NULL UNIQUE,
  password varchar(40) NOT NULL,
  group_name varchar(20) NOT NULL,
  fname varchar(20) NOT NULL,
  sname varchar(20) NOT NULL,
  address1 varchar(20) NOT NULL,
  address2 varchar(20) NOT NULL,
  city_town varchar(20) NOT NULL,
  county varchar(10) NOT NULL,
  PRIMARY KEY(user_id)
);

CREATE TABLE images(
images_id INT NOT NULL UNIQUE auto_increment,
name varchar(50) NOT NULL,
image longblob,
fk_user_id INT,
PRIMARY KEY(images_id),
FOREIGN KEY(fk_user_id) REfERENCES users(user_id)
);

CREATE TABLE messages(
message_id INT NOT NULL UNIQUE AUTO_INCREMENT,
my_post TEXT,
fk_user_id INT,
post_date DATETIME DEFAULT CURRENT_TIMESTAMP,
PRIMARY KEY(message_id),
FOREIGN KEY(fk_user_id) REfERENCES users(user_id)
);

